	SET $fraccion = DAY(NEW.fecha_recogida) - DAY(NEW.fecha_entrega);
  ELSE
	SET $periodo = DATEDIFF(NEW.fecha_recogida, NEW.fecha_entrega);
	SET $fraccion = HOUR(TIMEDIFF(NEW.fecha_recogida, NEW.fecha_entrega));
  END CASE;
  
  IF $fraccion < 0 THEN
	SET $fraccion = 0;
