	AND `fecha_inicio` >= NEW.fecha_entrega  AND `fecha_fin` <= NEW.fecha_recogida AND hasta <= $periodo
	ORDER BY hasta DESC 
	LIMIT 1;
	
	SET $periodo = $period - $diff;
	
	IF $periodo > 0 THEN
