	LEAVE loop_one ;
END LOOP loop_one ;
END IF;
IF NOT ISNULL(NEW.vehiculo_id) THEN
	SELECT (NEW.vehiculo_id, NEW.id, NEW.fecha_entrega, NEW.fecha_recogida, @momento);
