/* Procedure structure for procedure `flota__obtener_tarifa` */

/*!50003 DROP PROCEDURE IF EXISTS  `flota__obtener_tarifa` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `flota__obtener_tarifa`(orden INT, delegacion INT, tipo VARCHAR (5), tarifa VARCHAR (5), fecha_entrega DATE, fecha_recogida DATE, hora_entrega TIME, hora_recogida TIME)
    DETERMINISTIC
BEGIN
  DECLARE periodo INT DEFAULT 0 ;
  DECLARE fraccion INT DEFAULT 0 ;
  DECLARE fecha_inicio DATE DEFAULT NULL ;
  CASE tarifa 
  WHEN "HOUR" THEN
	IF DATEDIFF(fecha_recogida, fecha_entrega) > 0 
		THEN CALL flota__obtener_tarifa(orden,delegacion,tipo,"DAY",fecha_entrega,fecha_recogida,NULL,NULL);
	END IF ;
	SET periodo = TIMEDIFF(hora_recogida, hora_entrega);
	SET periodo = IF(periodo > 0,HOUR(periodo) + (MINUTE(hora_recogida)>MINUTE(hora_entrega)),0);
	SET fraccion = 0;
  WHEN "MONTH" THEN
	SET periodo = PERIOD_DIFF(DATE_FORMAT(fecha_recogida, '%Y%m'),DATE_FORMAT(fecha_entrega, '%Y%m')) ;
	SET fraccion = DAY(fecha_recogida) - DAY(fecha_entrega);
	SET fraccion = IF(fraccion>=0,fraccion + (TIMEDIFF(hora_recogida, hora_entrega)>0),0);
  ELSE
	SET tarifa = "DAY";
	SET periodo = DATEDIFF(fecha_recogida, fecha_entrega) ;
	SET fraccion = TIMEDIFF(hora_recogida, hora_entrega);
	SET fraccion = IF(fraccion>0,HOUR(fraccion) + (MINUTE(hora_recogida)>MINUTE(hora_entrega)),0);
  END CASE ;
  calc :LOOP
    CASE tarifa 
    WHEN "HOUR" THEN 
      SELECT t.id,t.fecha_inicio,t.fecha_fin,
	IF(periodo > t.hasta, t.hasta, periodo)
      INTO @id,@fecha_inicio,@fecha_fin,@period 
      FROM flota__tarifa t 
      WHERE t.delegacion_id = delegacion AND t.tipo_id = tipo AND t.tipo_tarifa = tarifa AND (fecha_entrega BETWEEN t.fecha_inicio AND t.fecha_fin) 
        AND (t.hasta < periodo XOR (periodo BETWEEN t.desde AND t.hasta)) 
      ORDER BY t.hasta DESC 
      LIMIT 1 ;
    WHEN "MONTH" THEN 
      SELECT t.id,t.fecha_inicio,t.fecha_fin,
        IF(t.fecha_fin < fecha_recogida,PERIOD_DIFF(DATE_FORMAT(t.fecha_fin, '%Y%m'),DATE_FORMAT(fecha_entrega, '%Y%m')),PERIOD_DIFF(DATE_FORMAT(fecha_recogida, '%Y%m'),DATE_FORMAT(fecha_entrega, '%Y%m'))) + 1 INTO @id,
        @fecha_inicio,
        @fecha_fin,
        @period 
      FROM flota__tarifa t 
      WHERE t.delegacion_id = delegacion AND t.tipo_id = tipo AND t.tipo_tarifa = tarifa AND (fecha_entrega BETWEEN t.fecha_inicio AND t.fecha_fin) 
        AND (IF(t.fecha_fin < fecha_recogida,PERIOD_DIFF(DATE_FORMAT(t.fecha_fin, '%Y%m'),DATE_FORMAT(fecha_entrega, '%Y%m')),PERIOD_DIFF(DATE_FORMAT(fecha_recogida, '%Y%m'),DATE_FORMAT(fecha_entrega, '%Y%m'))) BETWEEN t.desde AND t.hasta) 
      ORDER BY t.hasta DESC 
      LIMIT 1 ;
      SET fecha_entrega = DATE_ADD(fecha_entrega,INTERVAL @period MONTH) ;
    ELSE
      SELECT t.id,t.fecha_inicio,t.fecha_fin,
        IF(t.fecha_fin < fecha_recogida,DATEDIFF(t.fecha_fin, fecha_entrega),DATEDIFF(fecha_recogida, fecha_entrega)) + 1
      INTO @id,@fecha_inicio,@fecha_fin,@period 
      FROM flota__tarifa t 
      WHERE t.delegacion_id = delegacion AND t.tipo_id = tipo AND t.tipo_tarifa = tarifa AND (fecha_entrega BETWEEN t.fecha_inicio AND t.fecha_fin) 
        AND (IF(t.fecha_fin < fecha_recogida,DATEDIFF(t.fecha_fin, fecha_entrega),DATEDIFF(fecha_recogida, fecha_entrega)) BETWEEN t.desde AND t.hasta) 
      ORDER BY t.hasta DESC 
      LIMIT 1 ;
      SET fecha_entrega = DATE_ADD(fecha_entrega,INTERVAL @period DAY) ;
    END CASE ;
    VALUES (NULL,orden,@id,IF(periodo < @period, periodo, @period),IF(periodo - @period, 0, fraccion),@fecha_inicio,@fecha_fin,fecha_entrega,fecha_recogida) ;
    SET periodo = periodo - @period ;
    IF periodo > 0 THEN
	ITERATE calc ;
    END IF ;
    LEAVE calc ;
  END LOOP calc ;
END */$$
DELIMITER ;

/* Procedure structure for procedure `flota__obtener_tarifa2` */

/*!50003 DROP PROCEDURE IF EXISTS  `flota__obtener_tarifa2` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `flota__obtener_tarifa2`(
  delegacion INT,
  tipo VARCHAR (5),
  tarifa VARCHAR (5),
  fecha_entrega DATE,
  fecha_recogida DATE,
  hora_entrega TIME,
  hora_recogida TIME
)
    DETERMINISTIC
BEGIN
DECLARE periodo INT DEFAULT 0 ;
DECLARE temp INT DEFAULT 0 ;
DECLARE fraccion INT DEFAULT 0 ;
DECLARE fecha_inicio DATE DEFAULT NULL ;
DECLARE transaccion CHAR(36) DEFAULT UUID();
  
CASE tarifa 
WHEN "HOUR" THEN
	IF DATEDIFF(fecha_recogida,fecha_entrega) > 0 THEN
		CALl flota__obtener_tarifa(delegacion,tipo,"DAY",fecha_entrega,fecha_recogida,NULL,NULL);
	END IF;
	SET periodo = TIMEDIFF(hora_recogida, hora_entrega);
	SET periodo = IF(periodo > 0,HOUR(periodo) + (MINUTE(hora_recogida)>MINUTE(hora_entrega)),0);
	SET fraccion = 0;
WHEN "MONTH" THEN
	SET periodo = PERIOD_DIFF(DATE_FORMAT(fecha_recogida, '%Y%m'),DATE_FORMAT(fecha_entrega, '%Y%m')) ;
	SET fraccion = DAY(fecha_recogida) - DAY(fecha_entrega);
	SET fraccion = IF(fraccion>=0,fraccion + (TIMEDIFF(hora_recogida, hora_entrega)>0),0);
ELSE
	SET tarifa = "DAY";
	SET periodo = DATEDIFF(fecha_recogida, fecha_entrega) ;
	SET fraccion = TIMEDIFF(hora_recogida, hora_entrega);
	SET fraccion = IF(fraccion>0,HOUR(fraccion) + (MINUTE(hora_recogida)>MINUTE(hora_entrega)),0);
END CASE ;   
/*
IF periodo <= 0 THEN
	SET periodo = 1;
END IF;
*/
calc:LOOP
	CASE tarifa
	WHEN "HOUR" THEN
	SELECT t.id, t.fecha_inicio, t.fecha_fin, IF(periodo>t.hasta,t.hasta,periodo) 
	INTO @id, @fecha_inicio, @fecha_fin, @period
	FROM flota__tarifa t
	WHERE t.delegacion_id = delegacion AND t.tipo_id = tipo AND t.tipo_tarifa = tarifa AND (fecha_entrega BETWEEN t.fecha_inicio AND t.fecha_fin)
		AND (t.hasta < periodo xor (periodo BETWEEN t.desde AND t.hasta))
	ORDER BY t.hasta DESC
	LIMIT 1;
	
	WHEN "MONTH" THEN
	SELECT t.id, t.fecha_inicio, t.fecha_fin, IF(t.fecha_fin<fecha_recogida,PERIOD_DIFF(DATE_FORMAT(t.fecha_fin,'%Y%m'),DATE_FORMAT(fecha_entrega,'%Y%m')),PERIOD_DIFF(DATE_FORMAT(fecha_recogida,'%Y%m'),DATE_FORMAT(fecha_entrega,'%Y%m'))) + 1
	INTO @id, @fecha_inicio, @fecha_fin, @period
	FROM flota__tarifa t
	WHERE t.delegacion_id = delegacion AND t.tipo_id = tipo AND t.tipo_tarifa = tarifa AND (fecha_entrega BETWEEN t.fecha_inicio AND t.fecha_fin)
	    AND (IF(t.fecha_fin<fecha_recogida,PERIOD_DIFF(DATE_FORMAT(t.fecha_fin,'%Y%m'),DATE_FORMAT(fecha_entrega,'%Y%m')),PERIOD_DIFF(DATE_FORMAT(fecha_recogida,'%Y%m'),DATE_FORMAT(fecha_entrega,'%Y%m'))) BETWEEN t.desde AND t.hasta)
	ORDER BY t.hasta DESC
	LIMIT 1;
	SET fecha_entrega = DATE_ADD(fecha_entrega, INTERVAL @period MONTH);
	
	ELSE
	
	SELECT t.id, t.fecha_inicio, t.fecha_fin, IF(t.fecha_fin<fecha_recogida,DATEDIFF(t.fecha_fin,fecha_entrega),DATEDIFF(fecha_recogida,fecha_entrega)) + 1
	INTO @id, @fecha_inicio, @fecha_fin, @period
	FROM flota__tarifa t
	WHERE t.delegacion_id = delegacion AND t.tipo_id = tipo AND t.tipo_tarifa = tarifa AND (fecha_entrega BETWEEN t.fecha_inicio AND t.fecha_fin)
	    AND (IF(t.fecha_fin<fecha_recogida,DATEDIFF(t.fecha_fin,fecha_entrega),DATEDIFF(fecha_recogida,fecha_entrega)) BETWEEN t.desde AND t.hasta)
	ORDER BY t.hasta DESC
	LIMIT 1;
	
	SET fecha_entrega = DATE_ADD(fecha_entrega, INTERVAL @period DAY);
	END CASE;
	
	
	SET periodo = periodo - @period;
	IF periodo > 0 AND temp < 10 THEN
		SET temp = temp + 1;
		ITERATE calc ;
	END IF;
	
	LEAVE calc ;
END LOOP calc;
SELECT * FROM `__temporal_tarifas` WHERE `uuid`=transaccion;
END */$$
DELIMITER ;

